########### ATTITUDE EQ of MOTION %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
# interface -- triaxial or axisymm with one moment of inertia different from other two. 
"""
    getdragsaaveragedtermsattitudeeq(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,T7,T8,cdelta,sdelta,cpsih,spsih,vMAt,VVT1,VVT2,VVT3,VVT4)   
        function returning the averaged components of the attitude equations of motion depending on the atmospheric drag perturbation.
        Specifically, the average is performed over the fast attitude angles psil and psig. 
        The outcomes are suitables for triaxial bodies or axisymmetric bodies with one moment of inertia different from the other two. 
        
    INPUT 
    Consider the Sadov variables (Jl,Jg,Jh,psil,psig,psih)
    k    = C/A*(B-A)/(C-B), A,B,C moments of inertia
    k1r  = sqrt(1+k)
    skm  = k/(m+k)
    smk  = m/(k+m)
    m    = sadov implicit function of the actions Jl and Jg
    KK   = complete elliptic integral of first kind with parameter m
    T1, T2, T3, T6, T7, T8= variables including the false singularity m=0 (obatined through the function getsingularityterms in eqMotion_averagedmodel_girf.jl)
    cdelta = Jh/Jg
    sdelta = sqrt(1-Jh^2/Jg^2)
    cpsih  = cos(psih)
    spsih  = sin(psih)
    vMAt = vector containing the equinoctial terms (obtained through the function organizeMAterms_dragforce)
    VVTi = vector containing constants depending on the satellite geometry:
        for a single facet the vectors containing such constants are computed through the functions
            VVTi,j = drag_initforaverage_Tj
        VVTi = sum_j VVTi,j.
    
    
    OUTPUT   
    averaged terms of the equations of motion:
    skmBlock = -2*mx*b13*skm - 2*my*b23*(1-m)/(1+k)*skm + 2*smk*mz*b33
    TBblock1 = mx*b11+myb21+mzb31;
    TBblock2 = mx*b12+myb22+mzb32;
    TBblock3 = mx*b13+myb23+mzb33;
    TSblock  = mx*Sx+(1-m)*my*Sy+mz*Sz;
"""
function getdragsaaveragedtermsattitudeeq(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,T7,T8,cdelta,sdelta,cpsih,spsih,vMAt,VVT1,VVT2,VVT3,VVT4)         

    cMxb11T1,cMxb12T1,cMxb13T1,cMxpsilT1,cMyb21T1,cMyb22T1,cMyb23T1,cMypsilT1,cMzb31T1,cMzb32T1,cMzb33T1,cMzpsilT1 = dragsemianalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vMAt);
    cMxb11T2,cMxb12T2,cMxb13T2,cMxpsilT2,cMyb21T2,cMyb22T2,cMyb23T2,cMypsilT2,cMzb31T2,cMzb32T2,cMzb33T2,cMzpsilT2 = dragsemianalyticalaveragedcoeff_T2(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vMAt);
    cMxb11T3,cMxb12T3,cMxb13T3,cMxpsilT3,cMyb21T3,cMyb22T3,cMyb23T3,cMypsilT3,cMzb31T3,cMzb32T3,cMzb33T3,cMzpsilT3 = dragsemianalyticalaveragedcoeff_T3(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,T7,T8,cdelta,sdelta,cpsih,spsih,vMAt);
    cMxb11T4,cMxb12T4,cMxb13T4,cMxpsilT4,cMyb21T4,cMyb22T4,cMyb23T4,cMypsilT4,cMzb31T4,cMzb32T4,cMzb33T4,cMzpsilT4 = dragsemianalyticalaveragedcoeff_T4(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,T7,T8,cdelta,sdelta,cpsih,spsih,vMAt);
 
    Mxb11T1,Mxb12T1,Mxb13T1,MxpsilT1,Myb21T1,Myb22T1,Myb23T1,MypsilT1,Mzb31T1,Mzb32T1,Mzb33T1,MzpsilT1 = drag_averagedterms(VVT1,cMxb11T1,cMxb12T1,cMxb13T1,cMxpsilT1,cMyb21T1,cMyb22T1,cMyb23T1,cMypsilT1,cMzb31T1,cMzb32T1,cMzb33T1,cMzpsilT1);
    Mxb11T2,Mxb12T2,Mxb13T2,MxpsilT2,Myb21T2,Myb22T2,Myb23T2,MypsilT2,Mzb31T2,Mzb32T2,Mzb33T2,MzpsilT2 = drag_averagedterms(VVT2,cMxb11T2,cMxb12T2,cMxb13T2,cMxpsilT2,cMyb21T2,cMyb22T2,cMyb23T2,cMypsilT2,cMzb31T2,cMzb32T2,cMzb33T2,cMzpsilT2);
    Mxb11T3,Mxb12T3,Mxb13T3,MxpsilT3,Myb21T3,Myb22T3,Myb23T3,MypsilT3,Mzb31T3,Mzb32T3,Mzb33T3,MzpsilT3 = drag_averagedterms(VVT3,cMxb11T3,cMxb12T3,cMxb13T3,cMxpsilT3,cMyb21T3,cMyb22T3,cMyb23T3,cMypsilT3,cMzb31T3,cMzb32T3,cMzb33T3,cMzpsilT3);
    Mxb11T4,Mxb12T4,Mxb13T4,MxpsilT4,Myb21T4,Myb22T4,Myb23T4,MypsilT4,Mzb31T4,Mzb32T4,Mzb33T4,MzpsilT4 = drag_averagedterms(VVT4,cMxb11T4,cMxb12T4,cMxb13T4,cMxpsilT4,cMyb21T4,cMyb22T4,cMyb23T4,cMypsilT4,cMzb31T4,cMzb32T4,cMzb33T4,cMzpsilT4);

    # println("T1 ",[Mxb11T1,Mxb12T1,Mxb13T1,MxpsilT1,Myb21T1,Myb22T1,Myb23T1,MypsilT1,Mzb31T1,Mzb32T1,Mzb33T1,MzpsilT1])
    # println("T2 ",[Mxb11T2,Mxb12T2,Mxb13T2,MxpsilT2,Myb21T2,Myb22T2,Myb23T2,MypsilT2,Mzb31T2,Mzb32T2,Mzb33T2,MzpsilT2])
    # println("T3 ",[Mxb11T3,Mxb12T3,Mxb13T3,MxpsilT3,Myb21T3,Myb22T3,Myb23T3,MypsilT3,Mzb31T3,Mzb32T3,Mzb33T3,MzpsilT3])
    # println("T4 ",[Mxb11T4,Mxb12T4,Mxb13T4,MxpsilT4,Myb21T4,Myb22T4,Myb23T4,MypsilT4,Mzb31T4,Mzb32T4,Mzb33T4,MzpsilT4])

    mxb11 = Mxb11T1 + Mxb11T2 + Mxb11T3 + Mxb11T4; 
    mxb12 = Mxb12T1 + Mxb12T2 + Mxb12T3 + Mxb12T4; 
    mxb13 = Mxb13T1 + Mxb13T2 + Mxb13T3 + Mxb13T4;
    mxpsil = MxpsilT1 + MxpsilT2 + MxpsilT3 + MxpsilT4;

    myb21 = Myb21T1 + Myb21T2 + Myb21T3 + Myb21T4;
    myb22 = Myb22T1 + Myb22T2 + Myb22T3 + Myb22T4; 
    myb23 = Myb23T1 + Myb23T2 + Myb23T3 + Myb23T4;
    mypsil = MypsilT1 + MypsilT2 + MypsilT3 + MypsilT4; 

    mzb31 = Mzb31T1 + Mzb31T2 + Mzb31T3 + Mzb31T4; 
    mzb32 = Mzb32T1 + Mzb32T2 + Mzb32T3 + Mzb32T4;
    mzb33 = Mzb33T1 + Mzb33T2 + Mzb33T3 + Mzb33T4;
    mzpsil = MzpsilT1 + MzpsilT2 + MzpsilT3 + MzpsilT4; 

    skmBlock = -2*mxb13*skm - 2*myb23*(1-m)/(1+k)*skm + 2*smk*mzb33
    TBblock1 = mxb11+myb21+mzb31;
    TBblock2 = mxb12+myb22+mzb32;
    TBblock3 = mxb13+myb23+mzb33;
    TSblock  = mxpsil+(1-m)*mypsil+mzpsil;

    return skmBlock,TBblock1,TBblock2,TBblock3,TSblock;
end

# averaged terms
"""
    dragsemianalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Sadov angles. These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(sadov,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).    
    This function gives CC averaged over (psil,psig)
    Here only part of the torque is considered, the one related to:
    - the Fourier expansion of the drag force in the direction of the relative incident flow, up to the second harmonics.
    
    INPUT:
    Consider the Sadov variables (Jl,Jg,Jh,psil,psig,psih)
    k    = C/A*(B-A)/(C-B), A,B,C moments of inertia
    k1r  = sqrt(1+k)
    skm  = k/(m+k)
    smk  = m/(k+m)
    m    = sadov implicit function of the actions Jl and Jg
    KK   = complete elliptic integral of first kind with parameter m
    T1, T2, T3, T6 = variables including the false singularity m=0
    cdelta = Jh/Jg
    sdelta = sqrt(1-Jh^2/Jg^2)
    cpsih  = cos(psih)
    spsih  = sin(psih)
    vmt    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn*Sj.    
"""
function dragsemianalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt)
    vmt = vmt[1:20]
    coeffMxb11,coeffMxb12,coeffMxb13,coeffMxpsil,coeffMyb21,coeffMyb22,coeffMyb23,coeffMypsil,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzpsil = srpanalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt);    
    return coeffMxb11,coeffMxb12,coeffMxb13,coeffMxpsil,coeffMyb21,coeffMyb22,coeffMyb23,coeffMypsil,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzpsil; 
end

"""
    dragsemianalyticalaveragedcoeff_T2(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Sadov angles. These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(sadov,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).    
    This function gives CC averaged over (psil,psig)
    Here only part of the torque is considered, the one related to:
    - the third harmonics of the Fourier expansion of the drag force in the direction of the relative incident flow.
    - the Fourier expansion of the drag force in the direction of the facets' normals, up to the second harmonics.
    
    INPUT:
    Consider the Sadov variables (Jl,Jg,Jh,psil,psig,psih)
    k    = C/A*(B-A)/(C-B), A,B,C moments of inertia
    k1r  = sqrt(1+k)
    skm  = k/(m+k)
    smk  = m/(k+m)
    m    = sadov implicit function of the actions Jl and Jg
    KK   = complete elliptic integral of first kind with parameter m
    T1, T2, T3, T6 = variables including the false singularity m=0
    cdelta = Jh/Jg
    sdelta = sqrt(1-Jh^2/Jg^2)
    cpsih  = cos(psih)
    spsih  = sin(psih)
    vmt    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn*Sj.    
"""
function dragsemianalyticalaveragedcoeff_T2(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt)
    vmtN = vmt[21:40]
    vmtV = vmt[77:91]
    coeffMxb11N,coeffMxb12N,coeffMxb13N,coeffMxpsilN,coeffMyb21N,coeffMyb22N,coeffMyb23N,coeffMypsilN,coeffMzb31N,coeffMzb32N,coeffMzb33N,coeffMzpsilN = srpanalyticalaveragedcoeff_T2(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmtN);
    coeffMxb11V,coeffMxb12V,coeffMxb13V,coeffMxpsilV,coeffMyb21V,coeffMyb22V,coeffMyb23V,coeffMypsilV,coeffMzb31V,coeffMzb32V,coeffMzb33V,coeffMzpsilV =  dragsemianalyticalaveragedcoeff_fV_O3(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmtV);
   
    coeffMxb11  = coeffMxb11N + coeffMxb11V;
    coeffMxb12  = coeffMxb12N + coeffMxb12V;
    coeffMxb13  = coeffMxb13N + coeffMxb13V;
    coeffMxpsil = coeffMxpsilN + coeffMxpsilV;
    coeffMyb21  = coeffMyb21N + coeffMyb21V;
    coeffMyb22  = coeffMyb22N + coeffMyb22V;
    coeffMyb23  = coeffMyb23N + coeffMyb23V;
    coeffMypsil = coeffMypsilN + coeffMypsilV;
    coeffMzb31  = coeffMzb31N + coeffMzb31V;
    coeffMzb32  = coeffMzb32N + coeffMzb32V;
    coeffMzb33  = coeffMzb33N + coeffMzb33V;
    coeffMzpsil  = coeffMzpsilN + coeffMzpsilV;
    
    return coeffMxb11,coeffMxb12,coeffMxb13,coeffMxpsil,coeffMyb21,coeffMyb22,coeffMyb23,coeffMypsil,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzpsil;    
end

"""
