"""
function dragsemianalyticalaveragedcoeff_T3(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,T7,T8,cdelta,sdelta,cpsih,spsih,vmt)
    vmtN = vmt[21:40]
    vmtV = vmt[41:61]
    coeffMxb11N,coeffMxb12N,coeffMxb13N,coeffMxpsilN,coeffMyb21N,coeffMyb22N,coeffMyb23N,coeffMypsilN,coeffMzb31N,coeffMzb32N,coeffMzb33N,coeffMzpsilN = dragsemianalyticalaveragedcoeff_fN_O3(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmtN);
    coeffMxb11V,coeffMxb12V,coeffMxb13V,coeffMxpsilV,coeffMyb21V,coeffMyb22V,coeffMyb23V,coeffMypsilV,coeffMzb31V,coeffMzb32V,coeffMzb33V,coeffMzpsilV = dragsemianalyticalaveragedcoeff_fV_O4(k,k1r,skm,smk,m,KK,T1,T2,T3,T7,T8,cdelta,sdelta,cpsih,spsih,vmtV);    
   
    coeffMxb11  = coeffMxb11N + coeffMxb11V;
