function dragsemianalyticalaveragedcoeff_fN_O3(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vmt)
    coeffMxb11  = zeros(105,1); 
    coeffMxb12  = zeros(105,1); 
    coeffMxb13  = zeros(105,1); 
    coeffMxpsil = zeros(105,1); 
    coeffMyb21  = zeros(105,1); 
    coeffMyb22  = zeros(105,1); 
    coeffMyb23  = zeros(105,1); 
    coeffMypsil = zeros(105,1); 
    coeffMzb31  = zeros(105,1); 
    coeffMzb32  = zeros(105,1); 
    coeffMzb33  = zeros(105,1); 
    coeffMzpsil = zeros(105,1);
    
    t1 = sqrt(skm)
    t2 = t1 * pi
    t3 = vmt[10]
    t4 = t3 / 3
    t5 = vmt[19]
    t6 = -t4 + t5
    t7 = cpsih ^ 2
    t8 = t7 * cpsih
    t10 = vmt[16]
    t11 = vmt[20]
    t12 = t11 / 3
    t13 = t10 - t12
    t14 = t13 * spsih
    t15 = t7 * t14
    t16 = vmt[7]
    t17 = t16 - t5
    t19 = vmt[13]
    t21 = (t19 - t12) * spsih
    t22 = cpsih * t17 + t8 * t6 + t15 - t21
    t23 = k1r ^ 2
    t24 = smk * t23
    t26 = skm * m
    t29 = 8/7 * t24 + t26 - 8/7 * skm + 4/7 * smk
    t31 = cdelta ^ 2
    t32 = t31 * cdelta
    t34 = vmt[9]
    t35 = vmt[18]
    t36 = t34 - t35
    t38 = vmt[15]
    t39 = cpsih * t38
    t40 = spsih * t39
    t41 = 2 * t40
    t42 = vmt[4]
    t43 = t42 / 3
    t44 = t7 * t36 + t35 - t41 - t43
    t46 = t31 * sdelta
    t53 = (m - 8/7) * skm + (8/7 * t23 + 4/7) * smk
    t54 = 3 * t5
    t55 = t3 - t54
    t60 = t7 * spsih
    t71 = 3/2 * t5
    t72 = t16 - t71
    t73 = t23 * t72
    t74 = 3/4 * t16
    t75 = t3 / 4
    t76 = t5 / 2
    t84 = t19 + 3/17 * t10 - 4/17 * t11
    t90 = t11 / 2
    t91 = t19 - t90
    t92 = t23 * t91
    t93 = 3/4 * t19
    t94 = t10 / 4
    t105 = spsih * t29
