    bijsc[116] = -t5 * (smk * (T1 * (k - t789 + 10) - t936 + t789 - 5) - 9/4 * (T1 * (t35 - 16/9) - t35 + 8/9) * skm) * pi * t1 / 160
    bijsc[117] = -t1593 * (-t1634 + t1640) * k1r / 16
        

    return bijsc;
end

