"""
    getdragsaaveragedtermsattitudeeq_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt,VVT1,VVT2,VVT3,VVT4)    
        function returning the averaged components of the attitude equations of motion depending on the atmospheric drag perturbation.
        Specifically, the average is performed over the fast attitude angle g. 
        The outcomes are suitables for axisymmetric bodies with equal moments of inertia. 
        
    INPUT 
    Consider the Andoyer variables (L,G,H,l,g,psih)
    csigma = L/G
    cssigma = sqrt(1-L^2/G^2)
    cdelta = H/G
    sdelta = sqrt(1-H^2/G^2)
    chA  = cos(psih)
    shA  = sin(psih)
    vMAt = vector containing the equinoctial terms (obtained through the function organizeMAterms_dragforce)
    VVTi = vector containing constants depending on the satellite geometry:
        for a single facet the vectors containing such constants are computed through the functions
            VVTi,j = drag_initforaverage_Tj
        VVTi = sum_j VVTi,j.
    
    
    OUTPUT   
    averaged terms of the equations of motion:
    mxl = mx
    myl = my
    mzL = mz
    TBblock1 = mx*b11+my*b21+mz*b31;
    TBblock2 = mx*b12+my*b22+mz*b32;
    TBblock3 = mx*b13+my*b23+mz*b33;
"""
function getdragsaaveragedtermsattitudeeq_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt,VVT1,VVT2,VVT3,VVT4)         
    cMxb11T1,cMxb12T1,cMxb13T1,cMxpsilT1,cMyb21T1,cMyb22T1,cMyb23T1,cMypsilT1,cMzb31T1,cMzb32T1,cMzb33T1,cMzpsilT1 = dragsemianalyticalaveragedcoeff_T1_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt)
    cMxb11T2,cMxb12T2,cMxb13T2,cMxpsilT2,cMyb21T2,cMyb22T2,cMyb23T2,cMypsilT2,cMzb31T2,cMzb32T2,cMzb33T2,cMzpsilT2 = dragsemianalyticalaveragedcoeff_T2_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt)
    cMxb11T3,cMxb12T3,cMxb13T3,cMxpsilT3,cMyb21T3,cMyb22T3,cMyb23T3,cMypsilT3,cMzb31T3,cMzb32T3,cMzb33T3,cMzpsilT3 = dragsemianalyticalaveragedcoeff_T3_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt)
    cMxb11T4,cMxb12T4,cMxb13T4,cMxpsilT4,cMyb21T4,cMyb22T4,cMyb23T4,cMypsilT4,cMzb31T4,cMzb32T4,cMzb33T4,cMzpsilT4 = dragsemianalyticalaveragedcoeff_T4_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vMAt)

    Mxb11T1,Mxb12T1,Mxb13T1,MxpsilT1,Myb21T1,Myb22T1,Myb23T1,MypsilT1,Mzb31T1,Mzb32T1,Mzb33T1,MzpsilT1 = drag_averagedterms(VVT1,cMxb11T1,cMxb12T1,cMxb13T1,cMxpsilT1,cMyb21T1,cMyb22T1,cMyb23T1,cMypsilT1,cMzb31T1,cMzb32T1,cMzb33T1,cMzpsilT1);
    Mxb11T2,Mxb12T2,Mxb13T2,MxpsilT2,Myb21T2,Myb22T2,Myb23T2,MypsilT2,Mzb31T2,Mzb32T2,Mzb33T2,MzpsilT2 = drag_averagedterms(VVT2,cMxb11T2,cMxb12T2,cMxb13T2,cMxpsilT2,cMyb21T2,cMyb22T2,cMyb23T2,cMypsilT2,cMzb31T2,cMzb32T2,cMzb33T2,cMzpsilT2);
    Mxb11T3,Mxb12T3,Mxb13T3,MxpsilT3,Myb21T3,Myb22T3,Myb23T3,MypsilT3,Mzb31T3,Mzb32T3,Mzb33T3,MzpsilT3 = drag_averagedterms(VVT3,cMxb11T3,cMxb12T3,cMxb13T3,cMxpsilT3,cMyb21T3,cMyb22T3,cMyb23T3,cMypsilT3,cMzb31T3,cMzb32T3,cMzb33T3,cMzpsilT3);
    Mxb11T4,Mxb12T4,Mxb13T4,MxpsilT4,Myb21T4,Myb22T4,Myb23T4,MypsilT4,Mzb31T4,Mzb32T4,Mzb33T4,MzpsilT4 = drag_averagedterms(VVT4,cMxb11T4,cMxb12T4,cMxb13T4,cMxpsilT4,cMyb21T4,cMyb22T4,cMyb23T4,cMypsilT4,cMzb31T4,cMzb32T4,cMzb33T4,cMzpsilT4);

    mxb11 = Mxb11T1 + Mxb11T2 + Mxb11T3 + Mxb11T4; 
    mxb12 = Mxb12T1 + Mxb12T2 + Mxb12T3 + Mxb12T4; 
    mxb13 = Mxb13T1 + Mxb13T2 + Mxb13T3 + Mxb13T4;
    mxl = MxpsilT1 + MxpsilT2 + MxpsilT3 + MxpsilT4;

    myb21 = Myb21T1 + Myb21T2 + Myb21T3 + Myb21T4;
    myb22 = Myb22T1 + Myb22T2 + Myb22T3 + Myb22T4; 
    myb23 = Myb23T1 + Myb23T2 + Myb23T3 + Myb23T4;
    myl = MypsilT1 + MypsilT2 + MypsilT3 + MypsilT4; 

    mzb31 = Mzb31T1 + Mzb31T2 + Mzb31T3 + Mzb31T4; 
    mzb32 = Mzb32T1 + Mzb32T2 + Mzb32T3 + Mzb32T4;
    mzb33 = Mzb33T1 + Mzb33T2 + Mzb33T3 + Mzb33T4;
    mzL = MzpsilT1 + MzpsilT2 + MzpsilT3 + MzpsilT4; 

   
    TBblock1 = mxb11+myb21+mzb31;
    TBblock2 = mxb12+myb22+mzb32;
    TBblock3 = mxb13+myb23+mzb33;
    

    return mxl,myl,mzL,TBblock1,TBblock2,TBblock3;
end

# averaged parts 
"""
    dragsemianalyticalaveragedcoeff_T1_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Anodyer-serret angle g. These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(andoyer,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).    
    This function gives CC averaged over g.
    Here only part of the torque is considered, the one related to:
    - the Fourier expansion of the drag force in the direction of the relative incident flow, up to the second harmonics.
    
    INPUT:
    Consider the Andoyer variables (L,G,H,l,g,psih)
    csigma = L/G
    cssigma = sqrt(1-L^2/G^2)
    cdelta = H/G
    sdelta = sqrt(1-H^2/G^2)
    chA  = cos(psih)
    shA  = sin(psih)
    vmt    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn.        
"""
function dragsemianalyticalaveragedcoeff_T1_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    vmt = vmt[1:20]
    coeffMxb11,coeffMxb12,coeffMxb13,coeffMxl,coeffMyb21,coeffMyb22,coeffMyb23,coeffMl,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzL = srpanalyticalaveragedcoeff_T1_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    return coeffMxb11,coeffMxb12,coeffMxb13,coeffMxl,coeffMyb21,coeffMyb22,coeffMyb23,coeffMl,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzL; 
end

"""
    dragsemianalyticalaveragedcoeff_T2_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Anodyer-serret angle g. These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(andoyer,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).    
    This function gives CC averaged over g.
    Here only part of the torque is considered, the one related to:
        - the third harmonics of the Fourier expansion of the drag force in the direction of the relative incident flow.
        - the Fourier expansion of the drag force in the direction of the facets' normals, up to the second harmonics.
    
    INPUT:
    Consider the Andoyer variables (L,G,H,l,g,psih)
    csigma = L/G
    cssigma = sqrt(1-L^2/G^2)
    cdelta = H/G
    sdelta = sqrt(1-H^2/G^2)
    chA  = cos(psih)
    shA  = sin(psih)
    vmt    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn.        
"""
function dragsemianalyticalaveragedcoeff_T2_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    vmtN = vmt[21:40]
    vmtV = vmt[77:91]
    coeffMxb11N,coeffMxb12N,coeffMxb13N,coeffMxlN,coeffMyb21N,coeffMyb22N,coeffMyb23N,coeffMylN,coeffMzb31N,coeffMzb32N,coeffMzb33N,coeffMzLN = srpanalyticalaveragedcoeff_T2_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmtN);
    coeffMxb11V,coeffMxb12V,coeffMxb13V,coeffMxlV,coeffMyb21V,coeffMyb22V,coeffMyb23V,coeffMylV,coeffMzb31V,coeffMzb32V,coeffMzb33V,coeffMzLV = dragsemianalyticalaveragedcoeff_fV_O3_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmtV);
    coeffMxb11  = coeffMxb11N + coeffMxb11V;
    coeffMxb11  = coeffMxb11N + coeffMxb11V;
    coeffMxb12  = coeffMxb12N + coeffMxb12V;
    coeffMxb13  = coeffMxb13N + coeffMxb13V;
    coeffMxl = coeffMxlN + coeffMxlV;
    coeffMyb21  = coeffMyb21N + coeffMyb21V;
    coeffMyb22  = coeffMyb22N + coeffMyb22V;
    coeffMyb23  = coeffMyb23N + coeffMyb23V;
    coeffMyl = coeffMylN  + coeffMylV;
    coeffMzb31  = coeffMzb31N   + coeffMzb31V;
    coeffMzb32  = coeffMzb32N   + coeffMzb32V;
    coeffMzb33  = coeffMzb33N   + coeffMzb33V;
    coeffMzL  = coeffMzLN + coeffMzLV;
    
    return coeffMxb11,coeffMxb12,coeffMxb13,coeffMxl,coeffMyb21,coeffMyb22,coeffMyb23,coeffMyl,coeffMzb31,coeffMzb32,coeffMzb33,coeffMzL;    
