function dragsemianalyticalaveragedcoeff_fN_O3_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vmt)
    coeffMxb11  = zeros(105,1); 
    coeffMxb12  = zeros(105,1); 
    coeffMxb13  = zeros(105,1); 
    coeffMxl    = zeros(105,1); 
    coeffMyb21  = zeros(105,1); 
