    coeffMzb31  = zeros(105,1); 
    coeffMzb32  = zeros(105,1); 
    coeffMzb33  = zeros(105,1); 
    coeffMzL    = zeros(105,1);
    
    t1 = vmt[16]
    t2 = 3/4 * t1
    t3 = vmt[20]
    t4 = t3 / 4
    t5 = t2 - t4
    t6 = chA ^ 2
    t7 = t6 * chA
