    t28 = vmt[15]
    t30 = vmt[18]
    t31 = vmt[9]
    t32 = t30 - t31
    t33 = t32 * shA
    t37 = t28 * t6 - chA * t33 / 2 - t28 / 2
    t39 = cdelta * sdelta * t37
    t41 = -t7 * t5
    t42 = 11/20 * t1
    t43 = t3 / 5
    t44 = t17 / 20
    t47 = t21 / 4
    t48 = t10 / 4
    t49 = t9 - t47 - t48
    t50 = shA * t49
    t51 = t50 / 5
    t52 = t27 + t39 + t41 + t15 + chA * (t42 - t43 + t44) - t51
    t53 = t52 * slA
    t54 = csigma ^ 2
    t55 = t54 * csigma
    t58 = t10 / 6
    t60 = -t58 + t9 / 2
    t61 = t7 * t60
    t62 = t3 / 3
    t63 = t1 - t62
    t64 = t63 * shA
    t65 = t6 * t64
    t66 = t65 / 2
    t67 = -t22
    t68 = t67 / 2
    t70 = 3 * t17
    t71 = -t70 + t3
    t72 = t71 * shA
    t73 = t72 / 6
    t75 = t26 * cdelta
    t76 = t75 * (chA * t68 + t61 + t66 + t73)
    t77 = t32 / 2
    t78 = t6 * t77
    t79 = chA * shA
    t80 = t28 * t79
    t81 = vmt[4]
    t83 = t30 / 2
    t84 = t78 + t80 + t81 / 6 - t83
    t85 = t84 * sdelta
    t86 = t26 * t85
    t88 = -t7 * t60
    t90 = t10 / 30
    t91 = 7/15 * t9
    t92 = -11/30 * t21 - t90 + t91
    t94 = 4 * t3
    t96 = -t94 + 11 * t17 + t1
    t97 = t96 * shA
    t98 = t97 / 30
    t99 = chA * t92 - t66 + t88 + t98
    t101 = 2/5 * t30
    t102 = t81 / 10
    t103 = t31 / 10
    t104 = t78 + t80 - t101 + t102 + t103
    t105 = sdelta * t104
    t106 = t105 / 3
    t107 = cdelta * t99 - t106 + t76 + t86
    t108 = t107 * clA
    t113 = (t21 + t10) * shA
    t114 = t113 / 4
    t115 = t27 + t39 + t41 + t15 + chA * (t2 + t18) + t114
    t116 = t115 * slA
    t117 = csigma * t116
    t118 = 2/15 * t117
    t120 = t9 / 3
    t121 = -t21 / 2 - t58 + t120
    t124 = (t70 + t1) * shA
    t130 = t78 + t80 + t81 / 2 + t31 / 2
    t131 = t130 * sdelta
    t133 = t76 + t86 + cdelta * (t88 - t66 + chA * t121 + t124 / 6) - t131 / 3
    t134 = t133 * clA
    coeffMxb11[40] = 45/4 * ssigma * (-2/3 * t55 * t53 + t54 * t108 + t118 - t134 / 5)
    t138 = slA * clA
    t139 = t54 ^ 2
    t142 = 45/2 * t139 * t52 * t138
    t143 = clA ^ 2
    t144 = t143 + 1/2
    t147 = 45/2 * t55 * t107 * t144
    t153 = t21 / 3
    t155 = shA * (t9 - t153 - t11)
    t160 = 24 * t54 * (t27 + t39 + t41 + t15 + chA * (9/16 * t1 - 3/16 * t3 + t17 / 16) - 3/16 * t155) * t138
    t161 = t143 + 1/10
    t162 = t7 * t12
    t165 = t162 + t65 + chA * t67 + t72 / 3
    t168 = 90 * t75 * t165 * t161
    t170 = t26 * t84
    t172 = 180 * t170 * sdelta * t161
