    t209 = 60 * (t6 * t32 * t161 / 2 + chA * t161 * t200 + t204 + t205 + t206) * sdelta
    t214 = 3/2 * t115 * t138
    coeffMxb11[44] = t142 - t147 - t160 + csigma * (t168 + t172 + cdelta * (-t175 - t179 + chA * (t184 + t185 - t186 - t187) + t194) - t209) / 8 + t214
    t215 = csigma - 1
