# constant parts
"""
    drag_initforaverage_T1(surfi,rhoiv,niv)
    The attitude equations of motion contain terms Mn*bij, MnSj,  with Mn components of aerodynamics torque and bij,Sj terms depending on fast
    attitude angles. These terms can be written as Mn*bij/Sj = sum VV(alpha)*CC(attitude var,kep element), with alpha constant parameters depending 
    on the considered facet of the satellite.  This function gives the coefficients VV(alpha)

    INPUT 
        surfi = area of the facet
        rhoiv = centre of mass to facet centroid vector
        niv   = normal unit vector to the facet

    OUTPUT
    coefficients VV(alpha) [m^3]
"""
function drag_initforaverage_T1(surfi,rhoiv,niv)
    VV = zeros(30,1);
    count = 0;
    for rr=1:3
        for ii=0:2
            for jj=0:2
                for kk=0:2
                    if (ii+jj+kk)>2
                        break;
                    end
                    count = count+1;
                    VV[count]=rhoiv[rr]*niv[1]^ii*niv[2]^jj*niv[3]^kk*surfi/2.0;
                end
            end
        end
    end
    return VV;
end

