    coefficients VV(beta) [m^2]
"""
function drag_initforaverage_TV(surfi,niv)
    VV = zeros(35)
    count = 0;
    for ii=0:4
        for jj=0:4
            for kk=0:4
                if (ii+jj+kk)>4
                    break;
                end
                count = count+1;
                VV[count]=niv[1]^ii*niv[2]^jj*niv[3]^kk*surfi/2.0;
            end
        end
    end
    return VV;
end

"""
    drag_initforaverage_TN(surfi,niv)
    The Gauss planetary equations contains terms ak*g(M) with ak a component of the perturbing drag acceleration
    and g a function of the orbital mean anomaly. This terms can be written as
        ak*g(M) = VV(beta)*MM(sadov,Q1,Q2)*V(equinoctial)
    where VV(beta) is a vector of constants depending on the satellite geometry
    This function returns VV

    INPUT 
        surfi = area of the facet
        niv   = normal unit vector to the facet

    OUTPUT
    coefficients VV(beta) [m^2]
"""
function drag_initforaverage_TN(surfi,niv)
    VV = zeros(56)
    count = 0;
    for ii=0:5
        for jj=0:5
            for kk=0:5
                if (ii+jj+kk)>5
                    break;
                end
                count = count+1;
                VV[count]=niv[1]^ii*niv[2]^jj*niv[3]^kk*surfi/2.0;
            end
        end
    end
    return VV;
end

# assembly - strategy 1
"""
    getdragaveragedtermsgausseq_strategy1(VVfVdrag,VVfNdrag,k,k1r,skm,smk,m,KK,T1,T2,T3,cdelta,sdelta,cpsih,spsih,Q1,Q2,Idrag,mass)
    This function return the terms of the Gauss planetary equations depending on the orbital mean anomaly M and the sadov 
        variables, averaged over the attitude fast angles (psil,psig)

    Outcomes suitable in the case of a trixial satellite or axisymmetric with one moment of inertial different from the other two.

    The drag acceleration model is coherent with the one used in the attitude equations. 

        INPUTS
        VVfVdrag = vector containing constants depending on the satellite geometry:
            for a single facet the vectors containing such constants are computed through the functions
                VVTfVdrag_j = drag_initforaverage_TV
                VVfVdrag = sum_j VVTfVdrag_j.
        VVfNdrag = vector containing constants depending on the satellite geometry:
            for a single facet the vectors containing such constants are computed through the functions
                VVTfNdrag_j = drag_initforaverage_TN
                VVfNdrag = sum_j VVTfNdrag_j.
        NB: in case the exponential atmospheric model is selected this vectors must be multiplied by the adimensional drag coeffient 
        selected by the user (it is a satellite characteristic).
        Consider the Sadov variables (Jl,Jg,Jh,psil,psig,psih)
        k    = C/A*(B-A)/(C-B), A,B,C moments of inertia
        k1r  = sqrt(1+k)
        skm  = k/(m+k)
        smk  = m/(k+m)
        m    = sadov implicit function of the actions Jl and Jg
        KK   = complete elliptic integral of first kind with parameter m
        T1, T2, T3, T6 = variables including the false singularity m=0
        cdelta = Jh/Jg
        sdelta = sqrt(1-Jh^2/Jg^2)
        cpsih  = cos(psih)
        spsih  = sin(psih)
        Q1 = tan(i/2)*sin(O), i = inclination, O = right ascension of the ascending node
        Q2 = tan(i/2)*cos(O)
        Idrag = vector containing the equinoctial terms depending on the mean anomaly (obtained through the function organizeMAterms_dragforce)
        mass = mass of the satellite
    

        OUTPUTS
        averaged terms to be introduced in the Gauss planetary equations:
        sTL*fR,cTL*fR,fR/phiL,phiL*fT,fT/phiL,sTL*fT/phiL,cTL*fT/phiL,sTL*fT,cTL*fT,sTL*fN/phiL,cTL*fN/phiL
    
"""
function getdragaveragedtermsgausseq_strategy1(VVfVdrag,VVfNdrag,k,k1r,skm,smk,m,KK,T1,T2,T3,cdelta,sdelta,cpsih,spsih,Q1,Q2,Idrag,mass)

    fVCM,fN1CM,fN2CM,fN3CM = getDragForceTermsAveragedWRTAttitude(k,k1r,skm,smk,m,KK,T1,T2,T3,cdelta,sdelta,cpsih,spsih,Q1,Q2);
    
    fVCV  = transpose(VVfVdrag)*fVCM;
    fN1CV = transpose(VVfNdrag)*fN1CM;
    fN2CV = transpose(VVfNdrag)*fN2CM;
    fN3CV = transpose(VVfNdrag)*fN3CM;
    
    molt = 1.0/mass/1000.0

    nn = 35;
    sTLfR        =  (LinearAlgebra.dot(Idrag[1:nn],fVCV)          + LinearAlgebra.dot(Idrag[12*nn+1:13*nn],fN1CV) + LinearAlgebra.dot(Idrag[11*nn+1:12*nn],fN2CV))*molt
    cTLfR        =  (LinearAlgebra.dot(Idrag[nn+1:2*nn],fVCV)     + LinearAlgebra.dot(Idrag[13*nn+1:14*nn],fN1CV) + LinearAlgebra.dot(Idrag[12*nn+1:13*nn],fN2CV))*molt
    phiLM1fR     =  (LinearAlgebra.dot(Idrag[2*nn+1:3*nn],fVCV)   + LinearAlgebra.dot(Idrag[15*nn+1:16*nn],fN1CV) + LinearAlgebra.dot(Idrag[14*nn+1:15*nn],fN2CV))*molt
    phiLP1fT     =  (LinearAlgebra.dot(Idrag[3*nn+1:4*nn],fVCV)   - LinearAlgebra.dot(Idrag[19*nn+1:20*nn],fN1CV) + LinearAlgebra.dot(Idrag[20*nn+1:21*nn],fN2CV))*molt
    phiLM1fT     =  (LinearAlgebra.dot(Idrag[4*nn+1:5*nn],fVCV)   - LinearAlgebra.dot(Idrag[14*nn+1:15*nn],fN1CV) + LinearAlgebra.dot(Idrag[15*nn+1:16*nn],fN2CV))*molt
    phiLM1sTLfT  =  (LinearAlgebra.dot(Idrag[5*nn+1:6*nn],fVCV)   - LinearAlgebra.dot(Idrag[16*nn+1:17*nn],fN1CV) + LinearAlgebra.dot(Idrag[17*nn+1:18*nn],fN2CV))*molt
    phiLM1cTLfT  =  (LinearAlgebra.dot(Idrag[6*nn+1:7*nn],fVCV)   - LinearAlgebra.dot(Idrag[17*nn+1:18*nn],fN1CV) + LinearAlgebra.dot(Idrag[18*nn+1:19*nn],fN2CV))*molt
    sTLfT        =  (LinearAlgebra.dot(Idrag[7*nn+1:8*nn],fVCV)   - LinearAlgebra.dot(Idrag[11*nn+1:12*nn],fN1CV) + LinearAlgebra.dot(Idrag[12*nn+1:13*nn],fN2CV))*molt
    cTLfT        =  (LinearAlgebra.dot(Idrag[8*nn+1:9*nn],fVCV)   - LinearAlgebra.dot(Idrag[12*nn+1:13*nn],fN1CV) + LinearAlgebra.dot(Idrag[13*nn+1:14*nn],fN2CV))*molt
    phiLM1sTLfN  =  (LinearAlgebra.dot(Idrag[9*nn+1:10*nn],fVCV)  + LinearAlgebra.dot(Idrag[14*nn+1:15*nn],fN3CV))*molt
    phiLM1cTLfN  =  (LinearAlgebra.dot(Idrag[10*nn+1:11*nn],fVCV) + LinearAlgebra.dot(Idrag[15*nn+1:16*nn],fN3CV))*molt
    
    
    return sTLfR,cTLfR,phiLM1fR,phiLP1fT,phiLM1fT,phiLM1sTLfT,phiLM1cTLfT,sTLfT,cTLfT,phiLM1sTLfN,phiLM1cTLfN;
    # output in km/s^2.0

end

