#################################################################################################################################################
# AVERAGE WITH RESPECT TO MEAN ANOMALY (NUMERICAL)
##################################################################################################################################################
"""
    dragnumericallyaveragedterms(equi,mjd2000,cpa1,cpa2,cpa3,rPlanet,muPlanet,nE,planet_flat,oblateness,J2,includeDragTorque,includeDragAcc,atmosphericinfo,correctionJ2,couplingstrategy,inertial2equatorialRM
        Consider the terms contained in attitude and orbital equations, depending 
        on the orbital mean anomaly (together with other orbital parameter).
        The function compute their mean value with respect to the orbital mean anomaly.

    INPUTS:
    equi = equinoctial elements
    mjd2000 = reference epoch in modified julia day 20000
    cpai = components of the polar axis of the central body expressed in the inertial reference frame
    rPlanet = mean radius of the central planet
    muPlanet = gravitational parameter of the central planet
    nE = rotational angular rate of the central planet
    planet_flat = 1 to consider planet oblateness (important with an exponential model of the atmosphere)
    oblateness  = oblateness coefficient 
    J2 = J2 zonal harmonics
    includeDragTorque = boolean 
    includeAccTorque = boolean
    atmosphericinfo = Dict with info relative to the atmospheric model **
    correctionJ2 = boolean (it true, the earth-satellite distance is corrected to consider the coupling between drag and J2 effects)
    couplingstrategy = integer equal to either 1 or 2 depending on the orbital-attitude coupling strategy (1: drag acceleration model coherent with model implemented in attitude equations; 2: acceleration in the direction of
                        the relative incident strem)
    inertial2equatorialRM = rotation matrix from inertial reference frame to equatorial reference frame

    ** atmosphericinfo
    Dict with keys:
        atmosphericmodel = 1 exponential atmospheric model
        2 nrlmsise00
        other kind of model still not implemented

       
        AtmM =   
            if atmosphericmodel==1
            AtmM = matrix containing the exponential atmospheric model 
            in each row: [min altitude [km], density [kg/m^3], scale height [km]

    
            if atmosphericmodell==2
            AtmM = matrix with solar flux data with format
            In each row [jd-AP1-AP2-AP3-AP4-AP5-AP6-AP7-AP8-AP9-AP_AVG-f107_OBS-f107_OBS_CENTER81]
            with
            AP1 : Planetary Equivalent Amplitude (Ap) for 0000-0300 UT.
            AP2 : Planetary Equivalent Amplitude (Ap) for 0300-0600 UT.
            AP3 : Planetary Equivalent Amplitude (Ap) for 0600-0900 UT.
            AP4 : Planetary Equivalent Amplitude (Ap) for 0900-1200 UT.
            AP5 : Planetary Equivalent Amplitude (Ap) for 1200-1500 UT.
            AP6 : Planetary Equivalent Amplitude (Ap) for 1500-1800 UT.
            AP7 : Planetary Equivalent Amplitude (Ap) for 1800-2100 UT.
            AP8 : Planetary Equivalent Amplitude (Ap) for 2100-0000 UT.
            AP_AVG : Arithmetic average of the 8 Ap indices for the day.
            F10.7_OBS : Observed 10.7-cm Solar Radio Flux (F10.7). Measured at Ottawa at 1700 UT daily from 1947 Feb 14 until 1991 May 31 and measured at Penticton at 2000 UT from 1991 Jun 01 on. Expressed in units of 10-22 W/m2/Hz.
            F10.7_OBS_CENTER81 : Centered 81-day arithmetic average of F10.7 (observed).

        considerthermalCD = boolean (if true in the drag model also friction effects are included)

    OUTPUTS:
    meanOverMDrag_A = vector with averaged terms of the attitude equations
    meanOverMDrag_O = vector with averaged terms of the orbital equations

"""
function dragnumericallyaveragedterms(equi,mjd2000,cpa1,cpa2,cpa3,rPlanet,muPlanet,nE,planet_flat,oblateness,J2,includeDragTorque,includeDragAcc,atmosphericinfo,correctionJ2,couplingstrategy,inertial2equatorialRM)
  
    sma = equi[1]
    P1  = equi[2]
    P2  = equi[3]
    Q1  = equi[4]
    Q2  = equi[5]
    eta = sqrt(1.0-P1^2.0-P2^2.0)
    MLref = mod(equi[6],2.0*pi);
    TLcurrent = meanlong2truelong(MLref,P1,P2) 

    GG  = 1.0+Q1^2+Q2^2;
    q11 = (1.0-Q1^2+Q2^2)/GG;
    q12 = (2.0*Q1*Q2)/GG;
    q13 = (-2.0*Q1)/GG;
    q21 = (2.0*Q1*Q2)/GG;
    q22 = (1.0+Q1^2-Q2^2)/GG;
    q23 = (2.0*Q2)/GG;
    q31 = (2.0*Q1)/GG;
    q32 = (-2.0*Q2)/GG;
    q33 = (1.0-Q1^2-Q2^2)/GG;

    RQ2i = [q11 q21 q31;
            q12 q22 q32;
            q13 q23 q33];

    xi,wi    = FastGaussQuadrature.gausslegendre(90);
    TLV      = xi*pi .+ TLcurrent .+ pi
    MAterms  = getMAterms_drag(TLV,sma,P1,P2,eta,RQ2i,MLref,mjd2000,cpa1,cpa2,cpa3,rPlanet,muPlanet,nE,J2,planet_flat,oblateness,atmosphericinfo,correctionJ2,inertial2equatorialRM);
    MAfunsdragforce_A,MAfunsdragforce_O = organizeMAterms_dragforce(TLV,MAterms,P1,P2,eta,includeDragTorque,includeDragAcc,true,atmosphericinfo["considerthermalCD"],couplingstrategy);
    meanOverMDrag_A   = zeros(size(MAfunsdragforce_A)[2]);
    for jj = 1:size(MAfunsdragforce_A)[2]
        meanOverMDrag_A[jj] = sum(MAfunsdragforce_A[:,jj].*wi)/2.0;
    end  
    meanOverMDrag_O   = zeros(size(MAfunsdragforce_O)[2]);
    for jj = 1:size(MAfunsdragforce_O)[2]
        meanOverMDrag_O[jj] = sum(MAfunsdragforce_O[:,jj].*wi)/2.0;
    end  

    return meanOverMDrag_A,meanOverMDrag_O;  
end

"""
    dragnumericallyaveragedterms(TLV,MAterms,P1,P2,eta,includeDragTorque,includeDragAcc,multiplybydTLdM,considerthermalCD,couplingstrategy)
        Returns the terms contained in attitude and orbital equations, depending 
        on the orbital mean anomaly (together with other orbital parameter).

    INPUTS:
    TLV = vector [nx1] of true longitudes
    MAterms = matrix [nx7] 
                in each row:
                [eV0,V0,density,Sinf,Tinf,eV0rth]
                eV0 unit vector of the relative incident velocity in the inertial frame
                V0 magnitude of the relative velocity
                density atmospheric density
                Sinf mach number
                Tinf atmospheric temperature
                eVrth unit vector of the relative incident velocity in the radial-transversal-normal frame
    P1,P2 = equinoctial elements
    includeDragTorque = boolean 
    includeAccTorque = boolean
    multiplybydTLdM = boolean, if true, the outcomes are multiplied by dTLdM = eta^3/(1+P1sinTL+P2cosTL)
    considerthermalCD = boolean (if true in the drag model also friction effects are included)
    couplingstrategy = integer equal to either 1 or 2 depending on the orbital-attitude coupling strategy (1: drag acceleration model coherent with model implemented in attitude equations; 2: acceleration in the direction of
                        the relative incident strem)
   
    OUTPUTS:
    funA = matrix [nxm] with in each row the vector of terms depending on the mean anomaly appearing in the attitude equations
    funO = matrix [nxm] with in each row the vector of terms depending on the mean anomaly appearing in the orbital equations

"""
function organizeMAterms_dragforce(TLV,MAterms,P1,P2,eta,includeDragTorque,includeDragAcc,multiplybydTLdM,considerthermalCD,couplingstrategy)
    
    idxdeg0 = 1;
    idxdeg1 = [2,5,11];
    idxdeg2 = [3,6,8,12,14,17];
    idxdeg3 = [4,7,9,10,13,15,16,18,19,20];

    funA    = zeros(size(TLV)[1],91);
    funO    = zeros(size(TLV)[1],735);
    for ll = 1 : size(TLV)[1]
        eV0     = MAterms[ll,1:3];
        V0      = MAterms[ll,4];
        V0V     = eV0*V0;
        density = MAterms[ll,5];
        Sinf    = MAterms[ll,6];
        sTL     = sin(TLV[ll])
        cTL     = cos(TLV[ll])
        PhiL    = 1.0+P1*sTL+P2*cTL;
        eV0rth  = MAterms[ll,8:10];

        V0Vcomb = zeros(20);
        count = 0
        for ii = 0:3
            for jj = 0:3 
                for kk = 0:3
                    if ii+jj+kk>3
                        break
                    end
                    count = count +1;
                    V0Vcomb[count] = V0V[1]^ii*V0V[2]^jj*V0V[3]^kk;
                end
            end
        end
       
        V0Vcombdeg4 = zeros(15); 
        count = 0
        for hh = 1 : 3
            for ii = hh : 3
                for jj = ii : 3
                    for kk = jj : 3
                        count = count + 1; 
                        V0Vcombdeg4[count] = V0V[hh]*V0V[ii]*V0V[jj]*V0V[kk];
                    end
                end
            end
        end

        V0Vcombdeg5 = zeros(21); 
        count = 0
        for ss = 1 : 3 
            for hh = ss : 3
                for ii = hh : 3
                    for jj = ii : 3
                        for kk = jj : 3
                            count = count + 1; 
                            V0Vcombdeg5[count] = V0V[ss]*V0V[hh]*V0V[ii]*V0V[jj]*V0V[kk];
                        end
                    end
                end
            end
        end

        V0Vcombdeg6 = zeros(28); 
        count = 0
        for zz = 1:3
            for ss = zz : 3 
                for hh = ss : 3
                    for ii = hh : 3
                        for jj = ii : 3
                            for kk = jj : 3
                                count = count + 1; 
                                V0Vcombdeg6[count] = V0V[zz]*V0V[ss]*V0V[hh]*V0V[ii]*V0V[jj]*V0V[kk];
                            end
                        end
                    end
                end
            end
        end
        
        coefffV = zeros(35);
        coefffN = zeros(35);       
        if includeDragTorque
            V0VcombfV1 = deepcopy(V0Vcomb); 
            V0VcombfV1[idxdeg1] = V0VcombfV1[idxdeg1]*V0; #3.0/5.0  
            V0VcombfV1[idxdeg3] = V0VcombfV1[idxdeg3]/V0; #*9.0/5.0; 
            funA[ll,1:20] = V0VcombfV1;          
            # funA[ll,41:61] = V0Vcombdeg5*(-16.0/15.0/pi)/(V0^3.0);
        end
        if includeDragAcc 
            if couplingstrategy == 1
                coefffV[idxdeg0] =   V0Vcomb[idxdeg0]*V0^2.0; #*3.0/5.0;
                coefffV[idxdeg1] =   V0Vcomb[idxdeg1]*V0;
                coefffV[idxdeg2] =   V0Vcomb[idxdeg2]; #*9.0/5.0;
                # coefffV[21:35]   = V0Vcombdeg4*(-16/15/pi)/(V0^2.0)
            else
                coefffV[idxdeg0] =   V0Vcomb[idxdeg0]; #*3.0/5.0;
                coefffV[idxdeg1] =   V0Vcomb[idxdeg1]/V0;
                coefffV[idxdeg2] =   V0Vcomb[idxdeg2]/(V0^2.0); #*9.0/5.0/(V0^2.0);
                # coefffV[21:35]   = V0Vcombdeg4*(-16/15/pi)/(V0^4.0)
            end
        end
    
        if Sinf>0.0
            thetaV   = collect(range(0.0,pi/2,361)); 
            cthetaV  = cos.(thetaV);
            SnV      = Sinf*cthetaV;

            bsi0 = besseli(0.0,Sinf^2.0/2.0);
            bsi1 = besseli(1.0,Sinf^2.0/2.0);
            expSM = exp(-Sinf^2.0/2.0)
            expS  = exp(-Sinf^2.0)
            pi32   = pi^(3.0/2.0)
            hyp1  = pFq((1/2,1),(3/2,3/2),-Sinf^2.0)
            hyp2  = pFq((1/2,2),(3/2,5/2),-Sinf^2.0)
            hyp3  = pFq((1/2,3),(3/2,7/2),-Sinf^2.0)

                       
            ff2a0 = (pi32+4.0*hyp1*Sinf)/(4.0*pi32*Sinf^2.0)
            ff2a1 = (pi*Sinf*expSM*bsi0+pi*Sinf*expSM*bsi1+2.0*sqrt(pi))/(2.0*Sinf^2.0*pi32)
            ff2a2 = (8.0*hyp2-6.0*hyp1)/(3.0*pi32*Sinf)
            ff2a3 = -(pi*expSM*(Sinf^2.0-4.0)*bsi1+Sinf*(pi*Sinf*expSM*bsi0+2.0*sqrt(pi)))/(6.0*Sinf^3.0*pi32)
            ff2a4 = 2.0*(64.0*hyp3-80.0*hyp2+15.0*hyp1)/(15.0*Sinf*pi32)

            # ff2   = (1.0 .+  SpecialFunctions.erf.(SnV))/2.0/(Sinf^2.0);
            # ff2a0 = 1.0/pi*trapezoidalrule_V2(ff2,thetaV);
            # ff2a1 = 2.0/pi*trapezoidalrule_V2(ff2.*cthetaV,thetaV);
            # ff2a2 = 2.0/pi*trapezoidalrule_V2(ff2.*cos.(thetaV*2.0),thetaV);
            # ff2a3 = 2.0/pi*trapezoidalrule_V2(ff2.*cos.(thetaV*3.0),thetaV);
            # ff2a4 = 2.0/pi*trapezoidalrule_V2(ff2.*cos.(thetaV*4.0),thetaV);
        
            B0  = (ff2a0 - ff2a2 + ff2a4)*3.0*pi;
            B1  = (ff2a1 - 3.0*ff2a3)*2.0;
            B2  = (2.0*ff2a2 - 8.0*ff2a4)*3.0*pi/4.0;
            B3  = 4.0*ff2a3;
            B4  = 8.0*ff2a4;         
                        
            if considerthermalCD
                # ff1   = SpecialFunctions.erf.(SnV).*cthetaV + exp.(-SnV.^2.0)/Sinf/sqrt(pi); #.*(1.0 .+ tanh.(5.0*cthetaV))/2.0 
                # ff1a0 = 1.0/pi*trapezoidalrule_V2(ff1,thetaV);
                # ff1a1 = 2.0/pi*trapezoidalrule_V2(ff1.*cthetaV,thetaV);
                # ff1a2 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*2.0),thetaV);
                # ff1a3 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*3.0),thetaV);
                # ff1a4 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*4.0),thetaV);
                
                ff1a0 = expSM*((Sinf^2.0+1.0)*bsi0+Sinf^2.0*bsi1)/(2.0*sqrt(pi)*Sinf)
                ff1a1 = (8.0*Sinf^3.0*hyp2 + 3.0*expS*erfi(Sinf)*sqrt(pi))/(3.0*Sinf^2.0*pi32)
                ff1a2 = expSM*(Sinf^2.0*bsi0+(Sinf^2.0-1.0)*bsi1)/(3.0*sqrt(pi)*Sinf)
                ff1a3 = -8.0*(Sinf^5.0*hyp2 - 16.0*Sinf^5.0*hyp3/15.0 - erfi(Sinf)*sqrt(pi)*(Sinf^2.0+2.0)*expS/8.0 + Sinf/2.0)/(Sinf^4.0*pi32)
                ff1a4 = -expSM*((Sinf^4.0-4.0*Sinf^2.0+12.0)*bsi1+ Sinf^2.0*(Sinf^2.0-3.0)*bsi0)/(15.0*sqrt(pi)*Sinf^3.0)
            else
                ff1   = SpecialFunctions.erf.(SnV).*cthetaV + exp.(-SnV.^2.0)/Sinf/sqrt(pi).*cthetaV;
                ff1a0 = 1.0/pi*trapezoidalrule_V2(ff1,thetaV);
                ff1a1 = 2.0/pi*trapezoidalrule_V2(ff1.*cthetaV,thetaV);
                ff1a2 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*2.0),thetaV);
                ff1a3 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*3.0),thetaV);
                ff1a4 = 2.0/pi*trapezoidalrule_V2(ff1.*cos.(thetaV*4.0),thetaV);
            end           
        
            A0  = (ff1a0 - ff1a2 + ff1a4)*3.0*pi;
            A1  = (ff1a1 - 3.0*ff1a3)*2.0;
            A2  = (2.0*ff1a2 - 8.0*ff1a4)*3.0*pi/4.0;
            A3  = 4.0*ff1a3;
            A4  = 8.0*ff1a4;

            Tratio = sqrt(pi)/2.0/Sinf*sqrt(300.0/MAterms[ll,7]);
            VVfN = deepcopy(V0Vcomb);
            VVfN[idxdeg0] = VVfN[idxdeg0]*(Tratio + Tratio*A0 +B0)*V0^2.0; #*(Tratio*3.0/5.0 + Tratio*A0 +B0)*V0^2.0;
            VVfN[idxdeg1] = VVfN[idxdeg1]*(Tratio + Tratio*A1 +B1)*V0;
            VVfN[idxdeg2] = VVfN[idxdeg2]*(Tratio + Tratio*A2 +B2); #(Tratio*9.0/5.0 + Tratio*A2 +B2); 
            VVfN[idxdeg3] = VVfN[idxdeg3]*(Tratio*A3 + B3)/V0;
            VVfN4 = V0Vcombdeg4*(Tratio*A4 + B4)/(V0^2.0);
            
            if includeDragTorque
                V0VcombfV2 = deepcopy(V0Vcomb); 
                V0VcombfV2[idxdeg1] = V0VcombfV2[idxdeg1]*V0*A0
                V0VcombfV2[idxdeg2] = V0VcombfV2[idxdeg2]*A1
                V0VcombfV2[idxdeg3] = V0VcombfV2[idxdeg3]/V0*A2 

                funA[ll,1:20]   =  funA[ll,1:20]  + V0VcombfV2 ;
                funA[ll,21:40]  =  VVfN;
                funA[ll,41:61]  =  funA[ll,41:61] + V0Vcombdeg5*A4/(V0^3.0);
                funA[ll,62:76]  =  VVfN4;         
                funA[ll,77:91]  =  V0Vcombdeg4 * A3 / (V0^2.0); 
            end

            if includeDragAcc 
                if couplingstrategy == 1
                    coefffV[idxdeg0] =   coefffV[idxdeg0]*3.0/5.0 + V0Vcomb[idxdeg0]*A0*V0^2.0;
                    coefffV[idxdeg1] =   coefffV[idxdeg1] + V0Vcomb[idxdeg1]*A1*V0;
                    coefffV[idxdeg2] =   coefffV[idxdeg2]*9.0/5.0 + V0Vcomb[idxdeg2]*A2;
                    coefffV[idxdeg3] =   coefffV[idxdeg3] + V0Vcomb[idxdeg3]*A3/V0;
                    coefffV[21:35]   =   V0Vcombdeg4*(-16/15/pi)/(V0^2.0)   + V0Vcombdeg4*A4/(V0^2.0);
                    coefffN[1:20]    = VVfN;
                    coefffN[21:35]   = VVfN4;
                else
                    if considerthermalCD
                        ff3   = (1.0 .+  SpecialFunctions.erf.(SnV))/2.0/(Sinf^2.0).*cthetaV + Tratio*(cthetaV + SpecialFunctions.erf.(SnV).*cthetaV + exp.(-SnV.^2.0)/Sinf/sqrt(pi)).*cthetaV;
                    else
                        ff3   = (1.0 .+  SpecialFunctions.erf.(SnV))/2.0/(Sinf^2.0).*cthetaV + Tratio*(cthetaV + SpecialFunctions.erf.(SnV).*cthetaV + exp.(-SnV.^2.0)/Sinf/sqrt(pi).*cthetaV).*cthetaV;
                    end
                   
                    ff3a0 = 1.0/pi*trapezoidalrule_V2(ff3,thetaV);
                    ff3a1 = 2.0/pi*trapezoidalrule_V2(ff3.*cthetaV,thetaV);
                    ff3a2 = 2.0/pi*trapezoidalrule_V2(ff3.*cos.(thetaV*2.0),thetaV);
                    ff3a3 = 2.0/pi*trapezoidalrule_V2(ff3.*cos.(thetaV*3.0),thetaV);
                    ff3a4 = 2.0/pi*trapezoidalrule_V2(ff3.*cos.(thetaV*4.0),thetaV);
                
                    C0  = (ff3a0 - ff3a2 + ff3a4)*3.0*pi;
                    C1  = (ff3a1 - 3.0*ff3a3)*2.0;
                    C2  = (2.0*ff3a2 - 8.0*ff3a4)*3.0*pi/4.0;
                    C3  = 4.0*ff3a3;
                    C4  = 8.0*ff3a4;       

                    coefffV[idxdeg0] = coefffV[idxdeg0] + V0Vcomb[idxdeg0]*(A0 + C0)
                    coefffV[idxdeg1] = coefffV[idxdeg1] + V0Vcomb[idxdeg1]*(A1 + C1)/V0
                    coefffV[idxdeg2] = coefffV[idxdeg2] + V0Vcomb[idxdeg2]*(A2 + C2)/(V0^2.0);
                    coefffV[idxdeg3] = coefffV[idxdeg3] + V0Vcomb[idxdeg3]*(A3 + C3)/(V0^3.0);
                    coefffV[21:35]   = coefffV[21:35] + V0Vcombdeg4*(A4 + C4)/(V0^4.0);

                end
            end 
        end
        
        funA[ll,:] = funA[ll,:]*density;
        

        if includeDragAcc
            if couplingstrategy == 1
                # kg/m/s^2.0
                terms = append!(coefffV*eV0rth[1]*sTL, 
                            coefffV*eV0rth[1]*cTL,
                            coefffV*eV0rth[1]/PhiL,
                            coefffV*eV0rth[2]*PhiL,
                            coefffV*eV0rth[2]/PhiL,
                            coefffV*eV0rth[2]/PhiL*sTL,
                            coefffV*eV0rth[2]/PhiL*cTL,
                            coefffV*eV0rth[2]*sTL,
                            coefffV*eV0rth[2]*cTL,
                            coefffV*eV0rth[3]/PhiL*sTL,
                            coefffV*eV0rth[3]/PhiL*cTL,
                            coefffN*sTL^2.0,  
                            coefffN*cTL*sTL, 
                            coefffN*cTL^2.0, 
                            coefffN*sTL/PhiL,                                    
                            coefffN*cTL/PhiL,
                            coefffN*sTL^2.0/PhiL,
                            coefffN*cTL*sTL/PhiL,
                            coefffN*cTL^2.0/PhiL,                                    
                            coefffN*sTL*PhiL,
                            coefffN*cTL*PhiL,
                            );
                funO[ll,:] = terms*density
            else
                # kg/m/s^2.0
                aR  = -V0^2*eV0rth[1]*density 
                aT  = -V0^2*eV0rth[2]*density 
                aN  = -V0^2*eV0rth[3]*density 
                funO[ll,1] = sTL*aR
                funO[ll,2] = cTL*aR;
                funO[ll,3]  = PhiL*aT;
                funO[ll,4]  = 1.0/PhiL*aT;
                funO[ll,5] = sTL/PhiL*aT;
                funO[ll,6] = sTL*aT;
                funO[ll,7] = cTL/PhiL*aT;
                funO[ll,8] = cTL*aT;
                funO[ll,9] = sTL/PhiL*aN;
                funO[ll,10] = cTL/PhiL*aN;
                funO[ll,11] = 1/PhiL*aR;

                # adimensional
                funO[ll,12:46] = coefffV; 
            end
        end
       
        if multiplybydTLdM
            dTLdM = eta^3.0/(PhiL^2.0)
        else
            dTLdM = 1.0
        end
        funA[ll,:] = funA[ll,:]*dTLdM;
        funO[ll,:] = funO[ll,:]*dTLdM;
    end
    return funA,funO;
end

"""
    getMAterms_drag(TLV,sma,P1,P2,eta,RQ2i,ML_0,mjd2000_0,cpa1,cpa2,cpa3,rPlanet,muPlanet,nE,J2,planet_flat,oblateness,atmosphericinfo,correctionJ2,inertial2equatorialRM)
        Functions computing fundamental terms depending on the orbital mean anomaly depending on the equations of motion

    INPUTS:
    TLV = vector [nx1] of true longitudes
    sma,P1,P2 = equinoctial elements
    eta = sqrt(1-P1^2-P2^2)
    RQ2i = [q11 q21 q31;
            q12 q22 q32;
            q13 q23 q33];
            with
            q11 = (1.0-Q1^2+Q2^2)/GG;
            q12 = (2.0*Q1*Q2)/GG;
            q13 = (-2.0*Q1)/GG;
            q21 = (2.0*Q1*Q2)/GG;
            q22 = (1.0+Q1^2-Q2^2)/GG;
            q23 = (2.0*Q2)/GG;
            q31 = (2.0*Q1)/GG;
            q32 = (-2.0*Q2)/GG;
            q33 = (1.0-Q1^2-Q2^2)/GG;
            GG = 1+Q1^2+Q2^2,
            Q1,Q2 equinoctial element
    ML_0 reference mean longitude at reference epoch
    mjd2000_0 reference epoch in modified julia day 2000
    rPlanet = mean radius of the central planet
    muPlanet = gravitational parameter of the central planet
    planet_flat = 1 to consider planet oblateness (important with an exponential model of the atmosphere)
    J2 = J2 zonal harmonics
    nE = rotational angular rate of the central planet
    oblateness  = oblateness coefficient 
    atmosphericinfo = Dict with info relative to the atmospheric model **
    correctionJ2 = boolean (it true, the earth-satellite distance is corrected to consider the coupling between drag and J2 effects)
    couplingstrategy = integer equal to either 1 or 2 depending on the orbital-attitude coupling strategy (1: drag acceleration model coherent with model implemented in attitude equations; 2: acceleration in the direction of
                        the relative incident strem)
    inertial2equatorialRM = rotation matrix from inertial reference frame to equatorial reference frame

    ** atmosphericinfo
    Dict with keys:
        atmosphericmodel = 1 exponential atmospheric model
        2 nrlmsise00
        other kind of model still not implemented

       
        AtmM =   
            if atmosphericmodel==1
            AtmM = matrix containing the exponential atmospheric model 
            in each row: [min altitude [km], density [kg/m^3], scale height [km]

    
            if atmosphericmodell==2
            AtmM = matrix with solar flux data with format
            In each row [jd-AP1-AP2-AP3-AP4-AP5-AP6-AP7-AP8-AP9-AP_AVG-f107_OBS-f107_OBS_CENTER81]
            with
            AP1 : Planetary Equivalent Amplitude (Ap) for 0000-0300 UT.
            AP2 : Planetary Equivalent Amplitude (Ap) for 0300-0600 UT.
            AP3 : Planetary Equivalent Amplitude (Ap) for 0600-0900 UT.
            AP4 : Planetary Equivalent Amplitude (Ap) for 0900-1200 UT.
            AP5 : Planetary Equivalent Amplitude (Ap) for 1200-1500 UT.
            AP6 : Planetary Equivalent Amplitude (Ap) for 1500-1800 UT.
            AP7 : Planetary Equivalent Amplitude (Ap) for 1800-2100 UT.
            AP8 : Planetary Equivalent Amplitude (Ap) for 2100-0000 UT.
            AP_AVG : Arithmetic average of the 8 Ap indices for the day.
            F10.7_OBS : Observed 10.7-cm Solar Radio Flux (F10.7). Measured at Ottawa at 1700 UT daily from 1947 Feb 14 until 1991 May 31 and measured at Penticton at 2000 UT from 1991 Jun 01 on. Expressed in units of 10-22 W/m2/Hz.
            F10.7_OBS_CENTER81 : Centered 81-day arithmetic average of F10.7 (observed).

        considerthermalCD = boolean (if true in the drag model also friction effects are included)

    OUTPUTS:
    MAterms = matrix [nx7] 
                in each row:
                [eV0,V0,density,Sinf,Tinf,eV0rth]
                eV0 unit vector of the relative incident velocity in the inertial frame
                V0 magnitude of the relative velocity
                density atmospheric density
                Sinf mach number
                Tinf atmospheric temperature
                eVrth unit vector of the relative incident velocity in the radial-transversal-normal frame

"""
function getMAterms_drag(TLV,sma,P1,P2,eta,RQ2i,ML_0,mjd2000_0,cpa1,cpa2,cpa3,rPlanet,muPlanet,nE,J2,planet_flat,oblateness,atmosphericinfo,correctionJ2,inertial2equatorialRM)


    MAterms = zeros(size(TLV)[1],10);
    for ll = 1 : size(TLV)[1]
        TL = TLV[ll]
        cTL = cos(TL)
        sTL = sin(TL)
        Phi = 1.0+P1*sTL+P2*cTL;
        rc  = sma*eta^2/Phi;  # km
        if correctionJ2
            Delta_r_J2 = J2 * rPlanet^2 / (4 * eta^2.0 * sma) * (- RQ2i[1,3]^2.0*cos(2.0*TL) + RQ2i[2,3]^2.0*cos(2.0*TL) - 2*RQ2i[1,3]*RQ2i[2,3]*sin(2.0*TL) 
            + ( RQ2i[1,3]^2.0 + RQ2i[2,3]^2.0 - 2.0*RQ2i[3,3]^2.0)*( 1.0 + (P1*sTL+P2*cTL)/(1.0+eta) + 2*eta/Phi));
            rc = rc + Delta_r_J2;
        end
            
        atmmV  = nE*[cpa1,cpa2,cpa3]; # rad/s
        rVrth  = rc*[1.0,0.0,0.0] # km
        vVrth  = sqrt(muPlanet/sma/eta^2.0)*[P2*sTL-P1*cTL;Phi;0.0]
        Rrth2Q = [cTL -sTL 0.0; 
                    sTL cTL 0.0;
                    0.0 0.0 1.0];
        Rrth2i = RQ2i * Rrth2Q
        rV     = Rrth2i * rVrth
        vV     = Rrth2i * vVrth
        V0V    = (vV - LinearAlgebra.cross(atmmV,rV))*1000.0; # m/s
        V0     = sqrt(V0V[1]^2+V0V[2]^2+V0V[3]^2);
        eV0 = V0V/V0;
        eV0rth = transpose(Rrth2i)*eV0;

        if atmosphericinfo["atmosphericmodel"] == 1
            R_flat = rPlanet * planet_flat * (1 -  oblateness* (RQ2i[3,1]*cTL+RQ2i[3,2]*sTL)^2.0) +  rPlanet * (1 - planet_flat);
            density = exponential_atm_model(norm(rV)-R_flat,atmosphericinfo["AtmM"]);
            Sinf = -1.0
            Tinf = -1.0
        elseif atmosphericinfo["atmosphericmodel"] == 2
            deltaML = truelong2meanlong(TLV[ll],P1,P2)-ML_0;
            mjd2000 = mjd2000_0 +  deltaML*sqrt(sma^3/muPlanet)/86400.0;
            density,Tinf,ainf,ndens,Te = getatmosphereproperties_nrlmsise00(mjd2000,inertial2equatorialRM*rV,atmosphericinfo["AtmM"]);
            Sinf = V0/ainf
        end

        MAterms[ll,:] = append!(eV0,V0,density,Sinf,Tinf,eV0rth);
        # adimensional, m/s, kg/m^3.0, adimensional, K, adimensional


    end

    return MAterms;

end


####################################################################
# functions to study the drag perturbation [unused]
####################################################################
function getDragVal(psilV,psigV,TLV,MAterms,m,KK,EE,PP,k,k1r,skm,smk,cpsih,spsih,cdelta,sdelta,P1,P2,eta,includeDragTorque,includeDragAcc,satellite)
    
   
    psilpsigterms = getPsilPsigterms_drag(psigV,psilV,m,KK,EE,PP,k,k1r,sqrt(skm),sqrt(smk));
    Rhdelta = zeros(3,3);
    Rhdelta[1,1] = cpsih;
    Rhdelta[1,2] = spsih;
    Rhdelta[1,3] = 0.0;
    Rhdelta[2,1] = -cdelta*spsih;
    Rhdelta[2,2] = cdelta*cpsih;
    Rhdelta[2,3] = sdelta;
    Rhdelta[3,1] = sdelta*spsih;
    Rhdelta[3,2] = -sdelta*cpsih;
    Rhdelta[3,3] = cdelta;
    MMpsilpsigTL = zeros(size(psilV)[1],size(psigV)[1],size(TLV)[1],5);
    MOMpsilpsigTL = zeros(size(psilV)[1],size(psigV)[1],size(TLV)[1],3);
    for kk =1 : size(TLV)[1]
        eV0 = Rhdelta*MAterms[kk,1:3];
        densityV02 = MAterms[kk,4]^2.0*MAterms[kk,5];
        Sinf = MAterms[kk,6]
        Tratio = sqrt(pi)/2.0/Sinf*sqrt(300.0/MAterms[kk,7]);
        
        for jj = 1 : size(psigV)[1]
            for ii = 1: size(psilV)[1]
                Ri2b = [psilpsigterms[ii,jj,1] psilpsigterms[ii,jj,2] psilpsigterms[ii,jj,3];
                psilpsigterms[ii,jj,4] psilpsigterms[ii,jj,5] psilpsigterms[ii,jj,6];
                psilpsigterms[ii,jj,7] psilpsigterms[ii,jj,8] psilpsigterms[ii,jj,9]];
                eV0b = Ri2b*eV0;
     
                cdV = zeros(3)
                for ll = 1 : satellite["numberOfFacets"]
                    rhoiV = satellite["facets"][ll][3][1];
                    niV   = satellite["facets"][ll][4];
                    ctheta = LinearAlgebra.dot(niV,eV0b);
                    wavefun = max(0.0,ctheta/abs(ctheta));
                    dCVll = (exp(-Sinf^2*ctheta^2)/sqrt(pi)/Sinf + ctheta + erf(Sinf*ctheta)*ctheta)*wavefun
                    dCNll = (1.0+erf(Sinf*ctheta))/2.0/Sinf^2.0*wavefun+ Tratio*dCVll;
                    cdV = cdV   + satellite["facets"][ll][2]*(dCVll*LinearAlgebra.cross(rhoiV,eV0b)+dCNll*LinearAlgebra.cross(rhoiV,niV)); 
                end
                MM = -0.5*densityV02*cdV;
                skmBlock = -2*MM[1]*psilpsigterms[ii,jj,3]*skm - 2*MM[2]*psilpsigterms[ii,jj,6]*(1-m)/k1r*skm + 2*smk*MM[3]*psilpsigterms[ii,jj,9]
                TBblock1 = MM[1]*psilpsigterms[ii,jj,1]+MM[2]*psilpsigterms[ii,jj,4]+MM[3]*psilpsigterms[ii,jj,7];
                TBblock2 = MM[1]*psilpsigterms[ii,jj,2]+MM[2]*psilpsigterms[ii,jj,5]+MM[3]*psilpsigterms[ii,jj,8];
                TBblock3 = MM[1]*psilpsigterms[ii,jj,3]+MM[2]*psilpsigterms[ii,jj,6]+MM[3]*psilpsigterms[ii,jj,9];
                TSblock  = MM[1]*psilpsigterms[ii,jj,10]+(1-m)*MM[2]*psilpsigterms[ii,jj,11]+MM[3]*psilpsigterms[ii,jj,12];
                MMpsilpsigTL[ii,jj,kk,:] = [skmBlock,TBblock1,TBblock2,TBblock3,TSblock]*eta^3.0/((1.0+P1*sin(TLV[kk])+P2*cos(TLV[kk]))^2.0);
                MOMpsilpsigTL[ii,jj,kk,:] = MM;
            end
        end
    end
                
    return MMpsilpsigTL,MOMpsilpsigTL;
end


