# FUNCTIONS FOR NUMERICAL COMPUTATION OF GENERATING FUNCTIONS
##################################################################################################################################################

function getPsilPsigterms_drag(psigV,psilV,m,KK,EE,PP,k,k1r,skmR,smkR)

    out = zeros(size(psilV)[1],size(psigV)[1],12); 
    if smkR == 0.0
        smkRD = smkR+1e-15
    else
        smkRD = smkR;
    end
    for ii = 1 : size(psilV)[1]
        eF  = 2.0*KK*mod(psilV[ii],2.0*pi)/pi;
        lambda = Elliptic.Jacobi.am(eF,m);
        sn = sin(lambda);
        cn = cos(lambda);
        dn = sqrt(1.0-m*sn^2.0);
        eP  = ellP(-k,lambda,m); 
        eE  = ellE(lambda,m);
        zn  = eE-eF*EE/KK
        deltag = k1r/skmR*(eF/KK*PP-eP);
        dnkR  = sqrt(1+k*sn^2);

        for jj = 1 : size(psigV)[1]
            cgA = cos(psigV[jj]+deltag);
            sgA = sin(psigV[jj]+deltag);

            b11 = (-sgA*cn*dn*skmR-cgA*sn*k1r)/dnkR;
            b12 = ( cgA*cn*dn*skmR-sgA*sn*k1r)/dnkR;
            b13 = smkR*cn
            b21 = ( sgA*sn*dn*skmR*k1r-cgA*cn)/dnkR;
            b22 = (-cgA*sn*dn*skmR*k1r-sgA*cn)/dnkR;
            b23 = -smkR*k1r*sn
            b31 = smkR*sgA*dnkR
            b32 = -smkR*cgA*dnkR
            b33 = skmR*dn   
            Sx = (dn*sn-cn*zn)/smkR;
            Sy = (dn*cn+sn*zn)/smkR/k1r;
            Sz = (dn*zn-m*sn*cn)/skmR;
            out[ii,jj,:] = [b11,b12,b13,b21,b22,b23,b31,b32,b33,Sx,Sy,Sz];
        end
    end

    return out;
end

